import numpy as np

def max_value(inputlist,pos):
    return max(inputlist, key=lambda x: x[pos])

def min_value(inputlist,pos):
    return min(inputlist, key=lambda x: x[pos])


def normaliza_vector(vector):
    aux=vector.copy()
    max=np.amax(vector)
    min=np.amin(vector)
    for i in range(0,len(aux)):
        aux[i]=(aux[i]-min)/(max-min)
    return aux


def extraer_vec_pos(vector,pos):
    ss=[]
    for j in range(0,len(vector)):
        for i in range(0,len(vector[j])):
            #print(len(vector[j][i]))
            #print(vector[j][i][pos])
            ss.append(vector[j][i][pos])
    return ss




def normalizar_areas_length_band(nor):
    ar=extraer_vec_pos(nor,0)
    long=extraer_vec_pos(nor,1)
    ar_norm=normaliza_vector(ar)
    long_norm=normaliza_vector(long)
    count=0
    for j in range(0,len(nor)):
        for i in range(0,len(nor[j])):
            nor[j][i][0]=ar_norm[count]
            nor[j][i][1]=long_norm[count]
            #print("-------------------")
            #print(nor[j][i][2:len(nor[j][i])])
            band_norm=normaliza_vector(nor[j][i][2:len(nor[j][i])])
            #print(band_norm)
            nor[j][i][2:len(nor[j][i])]=band_norm
            #print(nor[j][i])
            #print(count)
            count=count+1
    return nor


